import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div className="row justify-content-end">
                <div className="col-xl-2 col-md-3 col-sm-4 col-4" style={logoStyle}>
                    <a href="#"><img src={logoimg} style={logoImgStyle} alt='Visit Creator`s site' /></a>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    backgroundColor: 'rgba(51, 51, 51, 0.7)',
    borderRadius: '20px',
    paddingTop: '2px',
}
const logoImgStyle = {
    width: '100%'
}
export default Logo
